function loadBookingList(o=1){$.ajax({method:"GET",url:URL_BOOKING_SITTER,data:{page:o}}).done(function(o){$("#booking-list").html(o)})}$(document).ready(function(){$(".em-identity-card").slick({slidesToShow:1,slidesToScroll:1,autoplay:!0,autoplaySpeed:1e3}),loadBookingList()}),$(document).on("click",".pagination a",function(o){o.preventDefault(),loadBookingList($(this).attr("href").split("page=")[1])});